import styled from "styled-components";
import back from "./image/back.png";

const DIV = styled.div`
    .select{
        margin: 0 auto;
        margin-top: 50px;
        max-width: 70%;
        transition: 0.2s all linear;
    }
    #course{
        border: 1px solid #e45a83;
        padding: 20px;
        font-size: 24px;
        border-radius: 5px;
        transition: 0.2s all linear;
        cursor: pointer;
    }
    #course:hover{
        background: black;
        border: 1px solid black;
        color: white;
    }
    img{
        width: "50%";
    }
`

const SelectCourse = () => {
    return (  
        <DIV className = "select-course">
            <p id = "steps-info-header">Select Course</p>
            <div className = "select">
                <div id = "course">
                    Computing and Engineering Sciences
                </div><br />
                <div id = "course">
                    Mass Communication
                </div>
            </div>
            <img src = {back}  ></img>            
        </DIV>
    );
}
 
export default SelectCourse;
